import React, {Component} from 'react';
import Menus from "../Menus";
import './Problem.css';
import FlowChart from "./FlowChart";
class ProContent extends React.Component {

    render() {
        return (
            <div>
                <div className={"menus"}>
                    <Menus/>

                </div>
                <FlowChart/>
            </div>
        );
    }
}

export default ProContent;
